import "./App.css";
import { BrowserRouter as Router, Route, Switches } from "react-router-dom";
import Home from "./pages/Home";

function App() {
  return <div className="App">
    <Router>
      <Switch>
        <Route path="/" exact component ={Home} />
      </Switch>
    </Router>
  </div>
}

export default App;
